from __future__ import absolute_import

import unittest
import nose
import time

from authress_sdk import ApiClient


class ServiceClientTokenProviderTest(unittest.TestCase):
  def setUp(self):
    pass

  def tearDown(self):
    pass

  def test_get_token(self):
    """Test case for get_token

    Get the token for a client registered as the token provider
    """

    access_key = ''

    authress_client = ApiClient("", access_key)
    token1 = authress_client.get_client_token()
    time.sleep(2)
    token2 = authress_client.get_client_token()
    nose.tools.eq_(token1, token2)
    pass

  def test_get_token_without_access_key(self):
    """Test case for get_token with no access key

    Ignores access keys that are None
    """

    authress_client = ApiClient("")
    token1 = authress_client.get_client_token()
    nose.tools.eq_(token1, None)
    pass

if __name__ == '__main__':
  unittest.main()